    "2016-10-29T19:05:39.184420",nt"name": "medicare-1144-outreach",nt"isopen":
    true,nt"url": null,nt"notes": "The purpose of this exchange is to identify
    any Medicare beneficiary who may be eligible for Medicare cost sharing under the
    Medicaid program, notify these potential Medicare buy-in eligible about the Medicare
    cost-sharing programs, and inform the states of potential buy-in eligible.Medicare
    Savings Programs are state-administered Medicaid programs which subsidize Medicare
    beneficiary costs. These programs usually follow SSI methods for counting income
    and resources but have higher limits. The income tests are based on a percentage
    of the Federal poverty guidelines and vary by program. Each year, two separate files
    will be created. The first file is scheduled for April and includes the QMB/SLMB/QI
    file. The second file is scheduled for November and includes the QDWI file.",nt"license_title":
